Condition : 5 - Prior to the commencement of development in Zone A, a School Construction Access and Management Strategy shall be submitted to and agreed in writing by the local planning authority. 
The School Construction Access and Management Strategy shall include the following:
a)	details of construction access identified in a scaled plan, demonstrating that construction vehicles can enter plot A6 in a safe manner throughout the entirety of construction period and be able to manoeuvre safety along the identified route (including appropriate turning space);  
b)	The construction period 
c)	Details of any temporary access over the green link that may be required up until the school has completed construction; 
d)	How long the access will be made available and how it would be retained and maintained; 
e)	That the proposed access route is suitable for construction vehicles without impeding on pedestrian safety and what temporary safeguards would be put in place, including any construction signage; 
f)	How construction vehicles would be managed through the site without impediment; and 
g)	Any full details reinstatement works and when that will be completed. 

The development shall only be completed and operated in accordance the approved School Construction Access and Management Strategy. 

REASON: To ensure that the delivery of the proposed school at construction stage is not prejudiced by the proposed development on Development Zone A and to ensure that the aspirations of the wider Harrow View Masterplan to bring forward a sustainable community development is met.

Condition : 6 - Notwithstanding the details shown on the approved drawings, the development shall not progress beyond damp proof course level in relation to each sub-phase (as so agreed pursuant to condition  6 (Phasing Strategy) of outline permission granted under ref: P/2165/15) until samples of the materials (or appropriate specification) to be used in the construction of the external surfaces noted below have been submitted to, and agreed in writing by, the local planning authority:
a)	facing materials for the buildings, including brick mortar and glazed brick to entrances;
b)	windows and doors;
c)	balconies including privacy screens and soffits;
d)	entrance canopies; 
e)	boundary treatment including all pedestrian/ access gates (including gates to parking courts);
f)	ground surfacing; 
g)	rainwater goods; 

The development shall be carried out in accordance with the details so agreed and shall be retained as such thereafter.

REASON: To ensure that the development is carried out to the highest standards of architecture and materials.

Condition : 21 - The non-residential premises located within development plots A1, A2, A4 and A5 hereby approved shall not be first occupied and used (as when each use comes forward) without the local planning authority's prior agreement, in writing, of the following details:

a)	a scheme for the projection of amplified sound to customers, neighbouring residents (including future occupiers) and other members of the public inside and (where relevant) outside of the building;
b)	any externally situated plant and/or other machinery;
c)	any externally situated temporary or permanent furniture, means of enclosure and other equipment associated with the extension of commercial activity outside of the building.

The occupation and use of the ground floor, including any part thereof, shall be carried out in accordance with the notification and details so agreed until such time as a material change of use occurs that is authorised either by any statutory instrument, local development order or by the local planning authority granting of planning permission.

REASON: To ensure that the operation of the ground floor uses and any associated equipment, plant, machinery and/or outdoor activity is compatible with residential and visual amenity.

